-block;\r\n margin-right: -4px;\r\n position: relative;\r\n padding: 15px 20px;\r\n background: none;\r\n\r\n cursor: pointer;\r\n -webkit-transition: all 0.2s;\r\n -moz-transition: all 0.2s;\r\n -ms-transition: all 0.2s;\r\n -o-transition: all 0.2s;\r\n transition: all 0.2s;\r\n}\r\n/*.main-nav ul li:hover {\r\n\r\ncolor: #fff;\r\n}*/\r\n.main-nav ul li ul {\r\n\r\n padding: 0;\r\n position: absolute;\r\n top: 48px;\r\n left: 0;\r\n width: 150px;\r\n -webkit-box-shadow: none;\r\n -moz-box-shadow: none;\r\n box-shadow: none;\r\n display: none;\r\n opacity: 0;\r\n\r\n visibility: hidden;\r\n -webkit-transiton: opacity 0.2s;\r\n -moz-transition: opacity 0.2s;\r\n -ms-transition: opacity 0.2s;\r\n -o-transition: opacity 0.2s;\r\n -transition: opacity 0.2s;\r\n}\r\n\r\n.main-nav ul li a{\r\n	text-decoration: none;\r\n	color: #fff;\r\n	\r\n}\r\n.main-nav ul li a:hover ul li{\r\n	border-top: 10px solid #0000;\r\n}\r\n\r\n.main-nav ul li ul li a\r\n{\r\n	color: #4e3838;\r\n	font-size: 13px;\r\n	font-weight: 400;\r\n	transition: all linear .1s;\r\n\r\n}\r\n.main-nav ul li ul li {\r\n	 text-decoration: none;\r\nwidth: 200px;\r\n background: #fff;\r\n display: block;\r\n color: #fff;\r\n text-shadow: 0 -1px 0 #000;\r\n}\r\n.main-nav ul li ul li:hover { background: none;  }\r\n.main-nav ul li:hover ul {\r\ncolor: #fff;\r\n\r\n display: block;\r\n background: #cfc7c7;\r\n width: 200px;\r\n opacity: 1;\r\n visibility: visible;\r\n}\r\n.main-nav ul li ul li a:hover{\r\n	\r\n margin-left: 8px;\r\n}\r\n";s:6:"shadow";s:3:"off";s:11:"transitions";s:3:"off";s:6:"resets";s:3:"off";s:17:"menu_item_divider";s:3:"off";s:27:"menu_item_highlight_current";s:3:"off";s:24:"flyout_menu_item_divider";s:3:"off";s:21:"disable_mobile_toggle";s:3:"off";s:19:"mobile_menu_overlay";s:3:"off";s:23:"mobile_menu_force_width";s:3:"off";}}', 'yes'),
